import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../styles/Auth.css';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const { login } = useAuth();
  const navigate = useNavigate();

  console.log('Login component rendered');
  console.log('useAuth:', { login: typeof login, navigate: typeof navigate });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    console.log('=== LOGIN PROCESS STARTED ===');
    console.log('1. Form submitted');
    console.log('2. Email:', formData.email);
    console.log('3. Password length:', formData.password.length);

    setError('');
    setLoading(true);
    console.log('4. Loading set to true');

    try {
      console.log('5. Calling login function...');
      const result = await login(formData.email, formData.password);
      console.log('6. Login function returned:', result);

      console.log('7. Checking localStorage token...');
      const token = localStorage.getItem('token');
      console.log('8. Token exists:', !!token);

      console.log('9. Attempting navigation to /...');
      navigate('/', { replace: true });
      console.log('10. Navigate called successfully');

    } catch (err) {
      console.error('ERROR in login process:');
      console.error('Error object:', err);
      console.error('Error message:', err.message);
      console.error('Error response:', err.response);
      console.error('Error response data:', err.response?.data);
      console.error('Error response status:', err.response?.status);

      const errorMsg = err.response?.data?.error || err.response?.data?.message || err.message || 'Failed to login';
      console.error('Setting error message:', errorMsg);
      setError(errorMsg);

    } finally {
      console.log('11. Setting loading to false');
      setLoading(false);
      console.log('=== LOGIN PROCESS ENDED ===');
    }
  };

  return (
    <div className="auth-page">
      <div className="auth-container">
        <div className="auth-header">
          <div className="auth-logo"></div>
          <h1 className="auth-title">MindCare</h1>
          <p className="auth-subtitle">Sign in to continue your mindfulness journey</p>
        </div>

        {error && (
          <div className="alert alert-error">
            {error}
          </div>
        )}

        <form className="auth-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label className="form-label">Email</label>
            <input
              type="email"
              name="email"
              className="form-input"
              placeholder="your@email.com"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label className="form-label">Password</label>
            <input
              type="password"
              name="password"
              className="form-input"
              placeholder=""
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn-submit" disabled={loading}>
            {loading ? 'Signing in...' : 'Sign In'}
          </button>
        </form>

        <div className="auth-footer">
          Don't have an account? <Link to="/register" className="auth-link">Sign Up</Link>
        </div>
      </div>
    </div>
  );
};

export default Login;
